import { Route, Routes } from 'react-router-dom';

import ProtectedRoute from './ProtectedRoute';
import CheckAuth from './CheckAuth';

import AdminLayout from '../layouts/AdminLayout';

import Dashboard from '../pages/dashboard/Dashboard';
import SignIn from '../pages/signin/SignIn';
import Student from '../pages/student/Student';
import UnderContruction from '../components/UnderContruction';

const AppRoutes = () => {
  return (
    <Routes>
      <Route path="/" element={<CheckAuth />} />
      <Route
        path="signin"
        element={
          <CheckAuth>
            <SignIn />
          </CheckAuth>
        }
      />

      <Route
        path="admin/*"
        element={
          <ProtectedRoute>
            <AdminLayout />
          </ProtectedRoute>
        }
      >
        <Route path="*" element={<UnderContruction />} />
        <Route
          path="course"
          element={
            <CheckAuth>
              <UnderContruction />
            </CheckAuth>
          }
        />
        <Route path="dashboard" element={<UnderContruction />} />
        <Route path="students" element={<UnderContruction />} />
        <Route path="payment" element={<UnderContruction />} />
        <Route path="report" element={<UnderContruction />} />
        <Route path="settings" element={<UnderContruction />} />
      </Route>
    </Routes>
  );
};

export default AppRoutes;
